import React from 'react';
import '../App.css';

const HotelCard = () => {
  return (
    <div className="hotel-card">
      <div className="card-image" style={{ backgroundImage: "url('./Assets/cards2.jpg')" }}>
        <div className="heart">
          <i className="fa fa-heart"></i>
        </div>
      </div>
      <div className="hotel-details">
        <h1>Serene Retreat</h1>
        <p>Location: Madrid</p>
        <p>Local category: ★★★★☆</p>
        <p>Price: 70€/room/night</p>
        <p className="hotel-description">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam nec leo ligula. Etiam fermentum est in euismod egestas.
          Curabitur ut condimentum ligula. Phasellus nunc velit, facilisis fermentum congue eu, cursus at leo. Interdum et malesuada fames ac ante ipsum primis in faucibus.
        </p>
        <button className="button">Contact</button>
      </div>
    </div>
  );
}

export default HotelCard;
